import React, {Component} from "react";
import "./SignUpBar.css";

class SignUpBar extends Component {
    render () {
        return (
            <div className = "signUpBar">
                <h1>Click Here to Get a FREE One Week Trial!</h1>
            </div>
        );
    }
}

export default SignUpBar;
